import React from 'react';
import Header from '../components/Header';

const Comments = () => {
    return (
        <div className='comments'>
            <Header />
            <main>
                <h2>Comments</h2>
                <section>
                    <h3>What they are saying</h3>
                </section>
            </main>
        </div>
    );
};

export default Comments;
